import React from 'react';
import './style.css';

export default function App() {
  return (
    <div className="menu">        
        <ul>
            <li><a href="http://localhost:3001/">Home</a></li>
            <li><a href="#">Lojas virtuais</a></li>
            <li><a href="#">Ongs</a></li>
            <li><a href="#">Cadastrar loja</a></li>
            <li><a href="#">Sobre</a></li>
            <li><a href="#">Contato</a></li>
        </ul>

        <div className="lojas-virtuais">
            <h1 href="https://xongani.com/">XONGANI</h1>
            <a>Fundada pela produtora Cris Mendonça e pela designer e estilista Ana Paula Xongani, a loja Xongani produz moda afro de qualidade por meio peças diversas, como vestidos, biquínis, sungas, bermudas e saídas de praia, além de peças sob medida para eventos. O propósito da Xongani é dar visibilidade à estética negra, e as peças contam com estampas maravilhosas, cheias de cor e energia.</a>

        </div>
    </div>


  );
}
